    body {

      margin: 0;
      padding: 0;
      display: flex;
      flex-direction: column;

    h1 {

    }

    form {
      background-color: #fff;
      padding: 20px;
      border-radius: 12px;
      box-shadow: 0 10px 20px rgba(0, 0, 0, 0.1);
      text-align: center;
      width: 90%;
      max-width: 400px;
      margin-bottom: 20px;
    }

    label {
      display: block;
      margin-bottom: 10px;
      font-weight: bold;
      font-size: 1rem;
      color: #555;
    }

    input[type="text"],
    input[type="file"] {
      width: 100%;
      padding: 10px;
      margin-bottom: 15px;
      border-radius: 8px;
      border: 1px solid #ddd;
      box-sizing: border-box;
      font-size: 1rem;
      background-color: #f9f9f9;
      box-shadow: inset 0 2px 5px rgba(0, 0, 0, 0.05);
      transition: all 0.3s ease;
    }

    input[type="text"]:focus,
    input[type="file"]:focus {
      border-color: #007bff;
      box-shadow: 0 0 8px rgba(0, 123, 255, 0.3);
      background-color: #fff;
    }

    button {
      background-color: #007bff;
      color: #fff;
      border: none;
      padding: 12px 20px;
      border-radius: 8px;
      cursor: pointer;
      font-size: 1rem;
      width: 100%;
      transition: background-color 0.3s ease, box-shadow 0.3s ease;
    }

    button:hover {
      background-color: #0056b3;
      box-shadow: 0 5px 15px rgba(0, 123, 255, 0.3);
    }

    #progress,
    #result {
      margin-top: 15px;
      color: #333;
      font-size: 0.9rem;
      text-align: center;
    }

    .qr-section {
      background-color: #fff;
      padding: 15px;
      border-radius: 12px;
      box-shadow: 0 10px 20px rgba(0, 0, 0, 0.1);
      text-align: center;
      margin-bottom: 20px;
      max-width: 400px;
      width: 90%;
    }

    .qr-section h2 {
      font-size: 1.25rem;
      color: #007bff;
      margin-bottom: 10px;
      display: flex;
      align-items: center;
      justify-content: center;
    }

    .qr-section h2 i {
      margin-right: 5px;
    }

    .qr-section p {
      margin: 10px 0;
      color: #555;
      font-size: 0.85rem;
    }

    .qr-section img {
      margin-top: 10px;
      width: 80%;
      max-width: 200px;
      height: auto;
      border-radius: 8px;
      box-shadow: 0 5px 10px rgba(0, 0, 0, 0.1);
    }

    footer {
      margin-top: 20px;
      text-align: center;
      color: #777;
      font-size: 0.9rem;
    }

    footer a {
      color: #007bff;
      text-decoration: none;
    }

    footer a:hover {
      text-decoration: underline;
    }

    /* 转圈加载动画样式 */
    #loading-spinner {
      border: 8px solid #f3f3f3;
      /* 灰色边框 */
      border-top: 8px solid #3498db;
      /* 蓝色的部分 */
      border-radius: 50%;
      width: 50px;
      height: 50px;
      animation: spin 1s linear infinite;
      /* 旋转动画 */
      display: none;
      /* 初始隐藏 */
      margin: 20px auto;
      /* 居中显示 */
    }

    @keyframes spin {
      0% {
        transform: rotate(0deg);
      }

      100% {
        transform: rotate(360deg);
      }
    }
  </style>
